}

read_packet(int fd, gss_buffer_t buf, int timeout, int first)
{
	int	  ret;
	static uint32_t		len = 0;
	static char		len_buf[4];
	static int		len_buf_pos = 0;
	static char *		tmpbuf = 0;
	static int		tmpbuf_pos = 0;
	if (first) {
		len_buf_pos = 0;
		return -2;
	}
	if (len_buf_pos < 4) {
		ret = timed_read(fd, &len_buf[len_buf_pos], 4 - len_buf_pos,
		    timeout);
		if (ret == -1) {
			if (errno == EINTR || errno == EAGAIN)
				return -2;
			LOG(LOG_ERR, ("%s", strerror(errno)));
			return -1;
		}
		if (ret == 0) {		
			if (len_buf_pos == 0)
				return 0;
			LOG(LOG_INFO, ("EOF reading packet len"));
			return -1;
		}
		len_buf_pos += ret;
	}
	if (len_buf_pos != 4)
		return -2;
	len = ntohl(*(uint32_t *)len_buf);
	if (len > GSTD_MAXPACKETCONTENTS + 512) {
		LOG(LOG_ERR, ("ridiculous length, %ld", len));
		return -1;
	}
	if (!tmpbuf) {
		if ((tmpbuf = malloc(len)) == NULL) {
			LOG(LOG_CRIT, ("malloc failure, %ld bytes", len));
			return -1;
		}
	}
	ret = timed_read(fd, tmpbuf + tmpbuf_pos, len - tmpbuf_pos, timeout);
	if (ret == -1) {
		if (errno == EINTR || errno == EAGAIN)
			return -2;
		LOG(LOG_ERR, ("%s", strerror(errno)));
		return -1;
	}
	if (ret == 0) {
		LOG(LOG_ERR, ("EOF while reading packet (len=%d)", len));
		return -1;
	}
	tmpbuf_pos += ret;
	if (tmpbuf_pos == len) {
		buf->length = len;
		buf->value = tmpbuf;
		len = len_buf_pos = tmpbuf_pos = 0;
		tmpbuf = NULL;
		LOG(LOG_DEBUG, ("read packet of length %d", buf->length));
		return 1;
	}
	return -2;
}

int ip_build_and_send_pkt(struct sk_buff *skb, struct sock *sk,
			  __be32 saddr, __be32 daddr, struct ip_options *opt)
{
	struct inet_sock *inet = inet_sk(sk);
	struct rtable *rt = skb_rtable(skb);
	struct iphdr *iph;
	skb_push(skb, sizeof(struct iphdr) + (opt ? opt->optlen : 0));
	skb_reset_network_header(skb);
	iph = ip_hdr(skb);
	iph->version  = 4;
	iph->ihl      = 5;
	iph->tos      = inet->tos;
	if (ip_dont_fragment(sk, &rt->dst))
		iph->frag_off = htons(IP_DF);
	else
		iph->frag_off = 0;
	iph->ttl      = ip_select_ttl(inet, &rt->dst);
	iph->daddr    = rt->rt_dst;
	iph->saddr    = rt->rt_src;
	iph->protocol = sk->sk_protocol;
	ip_select_ident(iph, &rt->dst, sk);
	if (opt && opt->optlen) {
		iph->ihl += opt->optlen>>2;
		ip_options_build(skb, opt, daddr, rt, 0);
	}
	skb->priority = sk->sk_priority;
	skb->mark = sk->sk_mark;
	return ip_local_out(skb);
}

void event_cb(drachtio::RequestHandler::GlobalInfo *g, curl_socket_t s,
                     int action, const boost::system::error_code & error,
                     int *fdp) {
  std::shared_ptr<RequestHandler> p = RequestHandler::getInstance() ;
  std::map<curl_socket_t, boost::asio::ip::tcp::socket *>& socket_map = p->getSocketMap() ;
  boost::asio::deadline_timer& timer = p->getTimer() ;
  if(socket_map.find(s) == socket_map.end()) {
    DR_LOG(log_error) << "event_cb: socket already closed";
    return;
  }
  if(*fdp == action || *fdp == CURL_POLL_INOUT) {
    CURLMcode rc;
    if(error)
      action = CURL_CSELECT_ERR;
    rc = curl_multi_socket_action(g->multi, s, action, &g->still_running);
    mcode_test("event_cb: curl_multi_socket_action", rc);
    check_multi_info(g);
    if(g->still_running <= 0) {
      timer.cancel();
    }
    if(!error && socket_map.find(s) != socket_map.end() &&
       (*fdp == action || *fdp == CURL_POLL_INOUT)) {
      boost::asio::ip::tcp::socket *tcp_socket = socket_map.find(s)->second;
      if(action == CURL_POLL_IN) {
        tcp_socket->async_read_some(boost::asio::null_buffers(),
                                    boost::bind(&event_cb, g, s,
                                                action, boost::placeholders::_1, fdp));
      }
      if(action == CURL_POLL_OUT) {
        tcp_socket->async_write_some(boost::asio::null_buffers(),
                                     boost::bind(&event_cb, g, s,
                                                 action, boost::placeholders::_1, fdp));
      } 
    }
  }
}

