		return 0;
	mpt_free_fw_memory(ioc);
	newFwSize = ALIGN(karg.newImageSize, 4);
	mpt_alloc_fw_memory(ioc, newFwSize);
	if (ioc->cached_fw == NULL)
		return -ENOMEM;
