register_disks_device (Device *device)
{
  DBusConnection *connection;
  GError *error = NULL;
  device->priv->system_bus_connection = dbus_g_bus_get (DBUS_BUS_SYSTEM, &error);
  if (device->priv->system_bus_connection == NULL)
    {
