dissect_spoolss_uint16uni(tvbuff_t *tvb, int offset, packet_info *pinfo _U_,
			  proto_tree *tree, guint8 *drep _U_, char **data,
			  int hf_name)
{
	gint len, remaining;
	char *text;
	if (offset % 2)
		offset += 2 - (offset % 2);
	remaining = tvb_captured_length_remaining(tvb, offset);
	if (remaining <= 0) {
		if (data)
			*data = g_strdup("");
		return offset;
	}
	text = tvb_get_string_enc(NULL, tvb, offset, remaining, ENC_UTF_16|ENC_LITTLE_ENDIAN);
	len = (int)strlen(text);
	proto_tree_add_string(tree, hf_name, tvb, offset, len * 2, text);
	if (data)
		*data = text;
	else
		g_free(text);
	return offset + (len + 1) * 2;
}

xfs_set_acl(struct inode *inode, struct posix_acl *acl, int type)
{
	int error = 0;
	if (!acl)
		goto set_acl;
	error = -E2BIG;
	if (acl->a_count > XFS_ACL_MAX_ENTRIES(XFS_M(inode->i_sb)))
		return error;
	if (type == ACL_TYPE_ACCESS) {
		umode_t mode = inode->i_mode;
		error = posix_acl_equiv_mode(acl, &mode);
		if (error <= 0) {
			acl = NULL;
			if (error < 0)
				return error;
		}
		error = xfs_set_mode(inode, mode);
		if (error)
			return error;
	}
 set_acl:
	return __xfs_set_acl(inode, type, acl);
}

MONGO_EXPORT bson_type bson_iterator_next( bson_iterator *i ) {
    int ds;
    if ( i->first ) {
        i->first = 0;
        return ( bson_type )( *i->cur );
    }
    switch ( bson_iterator_type( i ) ) {
    case BSON_EOO:
        return BSON_EOO; 
    case BSON_UNDEFINED:
    case BSON_NULL:
        ds = 0;
        break;
    case BSON_BOOL:
        ds = 1;
        break;
    case BSON_INT:
        ds = 4;
        break;
    case BSON_LONG:
    case BSON_DOUBLE:
    case BSON_TIMESTAMP:
    case BSON_DATE:
        ds = 8;
        break;
    case BSON_OID:
        ds = 12;
        break;
    case BSON_STRING:
    case BSON_SYMBOL:
    case BSON_CODE:
        ds = 4 + bson_iterator_int_raw( i );
        break;
    case BSON_BINDATA:
        ds = 5 + bson_iterator_int_raw( i );
        break;
    case BSON_OBJECT:
    case BSON_ARRAY:
    case BSON_CODEWSCOPE:
        ds = bson_iterator_int_raw( i );
        break;
    case BSON_DBREF:
        ds = 4+12 + bson_iterator_int_raw( i );
        break;
    case BSON_REGEX: {
        const char *s = bson_iterator_value( i );
        const char *p = s;
        p += strlen( p )+1;
        p += strlen( p )+1;
        ds = p-s;
        break;
    }
    default: {
        char msg[] = "unknown type: 000000000000";
        bson_numstr( msg+14, ( unsigned )( i->cur[0] ) );
        bson_fatal_msg( 0, msg );
        return 0;
    }
    }
    i->cur += 1 + strlen( i->cur + 1 ) + 1 + ds;
    return ( bson_type )( *i->cur );
}

