void Compute(OpKernelContext* c) override {
  const TensorList* input_list = nullptr;
  OP_REQUIRES_OK(c, GetInputList(c, 0, &input_list));
  OP_REQUIRES(c, TensorShapeUtils::IsScalar(c->input(1).shape()),
              errors::InvalidArgument("size must be a scalar"));
  int32_t size = c->input(1).scalar<int32>()();
  OP_REQUIRES(
      c, size >= 0,
      errors::InvalidArgument(
          "TensorListSlice expects size to be non-negative. Got: ", size));
  std::unique_ptr<Tensor> maybe_result =
      c->forward_input(0, 0, DT_VARIANT, TensorShape{},
                       c->input_memory_type(0), AllocatorAttributes());
  if (maybe_result != nullptr) {
    TensorList* out = maybe_result->scalar<Variant>()().get<TensorList>();
    if (out->RefCountIsOne()) {
      out->tensors().resize(size, Tensor(DT_INVALID));
      c->set_output(0, *maybe_result);
      return;
    }
  }
  Tensor* result;
  AllocatorAttributes attr;
  attr.set_on_host(true);
  OP_REQUIRES_OK(c, c->allocate_output(0, TensorShape{}, &result, attr));
  TensorList output_list;
  output_list.element_shape = input_list->element_shape;
  output_list.element_dtype = input_list->element_dtype;
  output_list.max_num_elements = input_list->max_num_elements;
  if (size > input_list->tensors().size()) {
    output_list.tensors().insert(output_list.tensors().begin(),
                                 input_list->tensors().begin(),
                                 input_list->tensors().end());
    output_list.tensors().resize(size, Tensor(DT_INVALID));
  } else {
    output_list.tensors().insert(output_list.tensors().begin(),
                                 input_list->tensors().begin(),
                                 input_list->tensors().begin() + size);
  }
  result->scalar<Variant>()() = std::move(output_list);
}

static char ** split(const char *arg, const char *delim) {
  char *copy = dupstr(arg);
  char **result = NULL;
  int i = 0;
  for (char *cptr = strtok(copy, delim); cptr; cptr = strtok(NULL, delim)) {
    char **tmp = realloc (result, sizeof *result * (i + 1));
    if (!tmp && result) {
      while (i > 0) {
	free(result[--i]);
      }
      free(result);
      free(copy);
      return NULL;
    }
    result = tmp;
    result[i++] = dupstr(cptr);
  }
  free(copy);
  if (i) {
    char **tmp = realloc(result, sizeof *result * (i + 1));
    if (!tmp) {
      while (i > 0) {
	free(result[--i]);
      }
      free(result);
      free(copy);
      return NULL;
    }
    result = tmp;
    result[i++] = NULL;
  }
  return result;
}

sds *ldbReplParseCommand(int *argcp) {
    sds *argv = NULL;
    int argc = 0;
    if (sdslen(ldb.cbuf) == 0) return NULL;
    sds copy = sdsdup(ldb.cbuf);
    char *p = copy;
    p = strchr(p,'*'); if (!p) goto protoerr;
    char *plen = p+1; 
    p = strstr(p,"\r\n"); if (!p) goto protoerr;
    *p = '\0'; p += 2;
    *argcp = atoi(plen);
    if (*argcp <= 0 || *argcp > 1024) goto protoerr;
    argv = zmalloc(sizeof(sds)*(*argcp));
    argc = 0;
    while(argc < *argcp) {
        if (*p != '$') goto protoerr;
        plen = p+1; 
        p = strstr(p,"\r\n"); if (!p) goto protoerr;
        *p = '\0'; p += 2;
        int slen = atoi(plen); 
        if (slen <= 0 || slen > 1024) goto protoerr;
        argv[argc++] = sdsnewlen(p,slen);
        p += slen; 
        if (p[0] != '\r' || p[1] != '\n') goto protoerr;
        p += 2; 
    }
    sdsfree(copy);
    return argv;
protoerr:
    sdsfreesplitres(argv,argc);
    sdsfree(copy);
    return NULL;
}

static inline neu_msg_t *neu_msg_new(neu_reqresp_type_e t, void *ctx,
                                     void *data)
{
    size_t data_size = neu_reqresp_size(t);
    size_t body_size = 0;
    switch (t) {
    case NEU_REQ_CHECK_SCHEMA:
        body_size = neu_reqresp_size(NEU_RESP_CHECK_SCHEMA);
        break;
    case NEU_REQ_GET_PLUGIN:
        body_size = neu_reqresp_size(NEU_RESP_GET_PLUGIN);
        break;
    case NEU_REQ_UPDATE_GROUP:
    case NEU_REQ_UPDATE_DRIVER_GROUP:
        body_size = neu_reqresp_size(NEU_RESP_UPDATE_DRIVER_GROUP);
        break;
    case NEU_REQ_UPDATE_NODE:
    case NEU_REQ_NODE_RENAME:
        body_size = neu_reqresp_size(NEU_RESP_NODE_RENAME);
        break;
    case NEU_REQ_DEL_NODE:
        body_size = neu_reqresp_size(NEU_RESP_NODE_UNINIT);
        break;
    case NEU_REQ_GET_NODE_SETTING:
        body_size = neu_reqresp_size(NEU_RESP_GET_NODE_SETTING);
        break;
    case NEU_REQ_GET_NODES_STATE:
        body_size = neu_reqresp_size(NEU_RESP_GET_NODES_STATE);
        break;
    default:
        body_size = data_size;
    }
    size_t     total = sizeof(neu_msg_t) + body_size;
    neu_msg_t *msg   = calloc(1, total);
    if (msg) {
        msg->head.type = t;
        msg->head.len  = total;
        msg->head.ctx  = ctx;
        if (data) {
            memcpy(msg->body, data, data_size);
        }
    }
    return msg;
}

MONGO_EXPORT int mongo_insert_batch( mongo *conn, const char *ns,
                                     const bson **bsons, int count, mongo_write_concern *custom_write_concern,
                                     int flags ) {
    mongo_message *mm;
    mongo_write_concern *write_concern = NULL;
    int i;
    char *data;
    int overhead =  16 + 4 + strlen( ns ) + 1;
    int size = overhead;
    if( mongo_validate_ns( conn, ns ) != MONGO_OK )
        return MONGO_ERROR;
    for( i=0; i<count; i++ ) {
        size += bson_size( bsons[i] );
        if( mongo_bson_valid( conn, bsons[i], 1 ) != MONGO_OK )
            return MONGO_ERROR;
    }
    if( ( size - overhead ) > conn->max_bson_size ) {
        conn->err = MONGO_BSON_TOO_LARGE;
        return MONGO_ERROR;
    }
    if( mongo_choose_write_concern( conn, custom_write_concern,
                                    &write_concern ) == MONGO_ERROR ) {
        return MONGO_ERROR;
    }
    mm = mongo_message_create( size , 0 , 0 , MONGO_OP_INSERT );
    data = &mm->data;
    if( flags & MONGO_CONTINUE_ON_ERROR )
        data = mongo_data_append32( data, &ONE );
    else
        data = mongo_data_append32( data, &ZERO );
    data = mongo_data_append( data, ns, strlen( ns ) + 1 );
    for( i=0; i<count; i++ ) {
        data = mongo_data_append( data, bsons[i]->data, bson_size( bsons[i] ) );
    }
    if( write_concern ) {
        if( mongo_message_send( conn, mm ) == MONGO_ERROR ) {
            return MONGO_ERROR;
        }
        return mongo_check_last_error( conn, ns, write_concern );
    }
    else {
        return mongo_message_send( conn, mm );
    }
}

