static bool IsValidPermutation(const std::string& src, const std::string& dst) {
  if (src.size() != dst.size()) {
    return false;
  }
  std::map<char, bool> characters;
  for (const auto c : src) {
    if (characters[c]) {
      return false;
    }
    characters[c] = true;
  }
  for (const auto c : dst) {
    if (!characters[c]) {
      return false;
    }
    characters[c] = false;
  }
  return true;
}

