int nfc_dev_down(struct nfc_dev *dev)
{
	int rc = 0;
	pr_debug("dev_name=%s\n", dev_name(&dev->dev));
	device_lock(&dev->dev);
	if (!device_is_registered(&dev->dev)) {
		rc = -ENODEV;
		goto error;
	}
	if (!dev->dev_up) {
		rc = -EALREADY;
		goto error;
	}
	if (dev->polling || dev->active_target) {
		rc = -EBUSY;
		goto error;
	}
	if (dev->ops->dev_down)
		dev->ops->dev_down(dev);
	dev->dev_up = false;
error:
	device_unlock(&dev->dev);
	return rc;
}

