static struct adpt_device* adpt_find_device(adpt_hba* pHba, u32 chan, u32 id, u64 lun)
{
	struct adpt_device* d;
	if (chan >= MAX_CHANNEL)
		return NULL;
	d = pHba->channel[chan].device[id];
	if(!d || d->tid == 0) {
		return NULL;
	}
	if(d->scsi_lun == lun){
		return d;
	}
	for(d=d->next_lun ; d ; d = d->next_lun){
		if(d->scsi_lun == lun){
			return d;
		}
	}
	return NULL;
}

static inline ut64 dwarf_read_address(size_t size, const ut8 **buf, const ut8 *buf_end) {
	ut64 result;
	switch (size) {
		case 2:
		result = READ16 (*buf); break;
		case 4:
		result = READ32 (*buf); break;
		case 8:
		result = READ64 (*buf); break;
		default:
		result = 0;
		*buf += size;
		eprintf ("Weird dwarf address size: %zu.", size);
	}
	return result;
}

