int CLASS ljpeg_diff (ushort *huff)
{
  int len, diff;
#ifdef LIBRAW_LIBRARY_BUILD
  if(!huff)
    throw LIBRAW_EXCEPTION_IO_CORRUPT;
#endif
  len = gethuff(huff);
  if (len == 16 && (!dng_version || dng_version >= 0x1010000))
    return -32768;
  diff = getbits(len);
  if ((diff & (1 << (len-1))) == 0)
    diff -= (1 << len) - 1;
  return diff;
}

