SPL_METHOD(SplDoublyLinkedList, offsetSet)
{
	zval                  *zindex, *value;
	spl_dllist_object     *intern;
	if (zend_parse_parameters(ZEND_NUM_ARGS(), "zz", &zindex, &value) == FAILURE) {
		return;
	}
	intern = Z_SPLDLLIST_P(getThis());
	if (Z_TYPE_P(zindex) == IS_NULL) {
		spl_ptr_llist_push(intern->llist, value);
	} else {
		zend_long                   index;
		spl_ptr_llist_element *element;
		index = spl_offset_convert_to_long(zindex);
		if (index < 0 || index >= intern->llist->count) {
			zval_ptr_dtor(value);
			zend_throw_exception(spl_ce_OutOfRangeException, "Offset invalid or out of range", 0);
			return;
		}
		element = spl_ptr_llist_offset(intern->llist, index, intern->flags & SPL_DLLIST_IT_LIFO);
		if (element != NULL) {
			if (intern->llist->dtor) {
				intern->llist->dtor(element);
			}
			zval_ptr_dtor(&element->data);
			ZVAL_COPY_VALUE(&element->data, value);
			if (intern->llist->ctor) {
				intern->llist->ctor(element);
			}
		} else {
			zval_ptr_dtor(value);
			zend_throw_exception(spl_ce_OutOfRangeException, "Offset invalid", 0);
			return;
		}
	}
}

static void check_hostalias(request_rec *r)
{
    const char *host = r->hostname;
    apr_port_t port;
    server_rec *s;
    server_rec *virthost_s;
    server_rec *last_s;
    name_chain *src;
    virthost_s = NULL;
    last_s = NULL;
    port = r->connection->local_addr->port;
    for (src = r->connection->vhost_lookup_data; src; src = src->next) {
        server_addr_rec *sar;
        sar = src->sar;
        if (sar->host_port != 0 && port != sar->host_port) {
            continue;
        }
        s = src->server;
        if (s != last_s) {
            if (matches_aliases(s, host)) {
                goto found;
            }
        }
        if (!strcasecmp(host, sar->virthost)) {
            if (virthost_s == NULL) {
                virthost_s = s;
            }
        }
        last_s = s;
    }
    if (virthost_s) {
        s = virthost_s;
        goto found;
    }
    return;
found:
    r->server = s;
}

isakmp_rfc3948_print(netdissect_options *ndo,
		     const u_char *bp, u_int length,
		     const u_char *bp2)
{
	if(length == 1 && bp[0]==0xff) {
		ND_PRINT((ndo, "isakmp-nat-keep-alive"));
		return;
	}
	if(length < 4) {
		goto trunc;
	}
	if(bp[0]==0 && bp[1]==0 && bp[2]==0 && bp[3]==0) {
		ND_PRINT((ndo, "NONESP-encap: "));
		isakmp_print(ndo, bp+4, length-4, bp2);
		return;
	}
	{
		int nh, enh, padlen;
		int advance;
		ND_PRINT((ndo, "UDP-encap: "));
		advance = esp_print(ndo, bp, length, bp2, &enh, &padlen);
		if(advance <= 0)
			return;
		bp += advance;
		length -= advance + padlen;
		nh = enh & 0xff;
		ip_print_inner(ndo, bp, length, nh, bp2);
		return;
	}
trunc:
	ND_PRINT((ndo,"[|isakmp]"));
	return;
}

flatpak_escape_string (const char        *s,
                       FlatpakEscapeFlags flags)
{
  g_autoptr(GString) res = g_string_new ("");
  gboolean did_escape = FALSE;
  while (*s)
    {
      gunichar c = g_utf8_get_char_validated (s, -1);
      if (c == (gunichar)-2 || c == (gunichar)-1)
        {
          append_hex_escaped_character (res, (unsigned char)*s++);
          did_escape = TRUE;
          continue;
        }
      else if (should_hex_escape (c, flags))
        {
          append_hex_escaped_character (res, c);
          did_escape = TRUE;
        }
      else if (c == '\\' || (!(flags & FLATPAK_ESCAPE_DO_NOT_QUOTE) && c == '\''))
        {
          g_string_append_printf (res, "\\%c", (char) c);
          did_escape = TRUE;
        }
      else
        g_string_append_unichar (res, c);
      s = g_utf8_find_next_char (s, NULL);
    }
  if (did_escape && !(flags & FLATPAK_ESCAPE_DO_NOT_QUOTE))
    {
      g_string_prepend_c (res, '\'');
      g_string_append_c (res, '\'');
    }
  return g_string_free (g_steal_pointer (&res), FALSE);
}

