njs_string_alloc(njs_vm_t *vm, njs_value_t *value, uint64_t size,
    uint64_t length)
{
    uint32_t      total, map_offset, *map;
    njs_string_t  *string;
    if (njs_slow_path(size > NJS_STRING_MAX_LENGTH)) {
        njs_range_error(vm, "invalid string length");
        return NULL;
    }
    value->type = NJS_STRING;
    njs_string_truth(value, size);
    if (size <= NJS_STRING_SHORT) {
        value->short_string.size = size;
        value->short_string.length = length;
        return value->short_string.start;
    }
    value->short_string.size = NJS_STRING_LONG;
    value->short_string.length = 0;
    value->long_string.external = 0;
    value->long_string.size = size;
    if (size != length && length > NJS_STRING_MAP_STRIDE) {
        map_offset = njs_string_map_offset(size);
        total = map_offset + njs_string_map_size(length);
    } else {
        map_offset = 0;
        total = size;
    }
    string = njs_mp_alloc(vm->mem_pool, sizeof(njs_string_t) + total);
    if (njs_fast_path(string != NULL)) {
        value->long_string.data = string;
        string->start = (u_char *) string + sizeof(njs_string_t);
        string->length = length;
        string->retain = 1;
        if (map_offset != 0) {
            map = (uint32_t *) (string->start + map_offset);
            map[0] = 0;
        }
        return string->start;
    }
    njs_memory_error(vm);
    return NULL;
}

static int ip_identify_match_check(void *obj, void *arg, int flags)
{
	struct ip_identify_match *identify = obj;
	struct ast_sockaddr_with_tp *addr_with_tp = arg;
	struct ast_sockaddr address = addr_with_tp->addr;
	int sense;
	sense = ast_apply_ha(identify->matches, &address);
	if (sense != AST_SENSE_ALLOW) {
		ast_debug(3, "Address %s matches identify '%s'\n",
				ast_sockaddr_stringify(&address),
				ast_sorcery_object_get_id(identify));
		if (ast_strlen_zero(identify->transport) || !strcasecmp(identify->transport, addr_with_tp->tp)) {
			ast_debug(3, "Transport %s matches identify '%s'\n",
				addr_with_tp->tp,
				ast_sorcery_object_get_id(identify));
			return CMP_MATCH;
		} else {
			ast_debug(3, "Transport %s match not matched identify '%s'\n",
				addr_with_tp->tp,
				ast_sorcery_object_get_id(identify));
			return 0;
		}
	} else {
		ast_debug(3, "Address %s does not match identify '%s'\n",
				ast_sockaddr_stringify(&address),
				ast_sorcery_object_get_id(identify));
		return 0;
	}
}

