static ssize_t yurex_read(struct file *file, char __user *buffer, size_t count,
			  loff_t *ppos)
{
	struct usb_yurex *dev;
	int retval = 0;
	int bytes_read = 0;
	char in_buffer[20];
	unsigned long flags;
	dev = file->private_data;
	mutex_lock(&dev->io_mutex);
	if (!dev->interface) {		
		retval = -ENODEV;
		goto exit;
	}
	spin_lock_irqsave(&dev->lock, flags);
	bytes_read = snprintf(in_buffer, 20, "%lld\n", dev->bbu);
	spin_unlock_irqrestore(&dev->lock, flags);
	if (*ppos < bytes_read) {
		if (copy_to_user(buffer, in_buffer + *ppos, bytes_read - *ppos))
			retval = -EFAULT;
		else {
			retval = bytes_read - *ppos;
			*ppos += bytes_read;
		}
	}
exit:
	mutex_unlock(&dev->io_mutex);
	return retval;
}

void HTTPServer::handleRequest(Client *cl, HTTPRequest* req) {
	if (!req->parse()) {
		std::cout << "[" << cl->getClientIP() << "] There was an error processing the request of type: " << req->methodIntToStr(req->getMethod()) << std::endl;
		std::cout << req->getParseError() << std::endl;
		sendStatusResponse(cl, Status(BAD_REQUEST), req->getParseError());
		return;
	}
	std::cout << "[" << cl->getClientIP() << "] " << req->methodIntToStr(req->getMethod()) << " " << req->getRequestUri() << std::endl;
	ResourceHost* resHost = NULL;
	std::string host = "";
	if (req->getVersion().compare(HTTP_VERSION_11) == 0) {
		host = req->getHeaderValue("Host");
		if (host.find(":") == std::string::npos) {
			host.append(":" + std::to_string(listenPort));
		}
		std::unordered_map<std::string, ResourceHost*>::const_iterator it = vhosts.find(host);
		if (it != vhosts.end())
			resHost = it->second;
	} else {
		if (hostList.size() > 0)
			resHost = hostList[0];
	}
	if (resHost == NULL) {
		sendStatusResponse(cl, Status(BAD_REQUEST), "Invalid/No Host specified: " + host);
		return;
	}
	switch (req->getMethod()) {
	case Method(HEAD):
	case Method(GET):
		handleGet(cl, req, resHost);
		break;
	case Method(OPTIONS):
		handleOptions(cl, req);
		break;
	case Method(TRACE):
		handleTrace(cl, req);
		break;
	default:
		std::cout << "[" << cl->getClientIP() << "] Could not handle or determine request of type " << req->methodIntToStr(req->getMethod()) << std::endl;
		sendStatusResponse(cl, Status(NOT_IMPLEMENTED));
		break;
	}
}

static void add_password(AUTH_HDR *request, unsigned char type, CONST char *password, char *secret)
{
	MD5_CTX md5_secret, my_md5;
	unsigned char misc[AUTH_VECTOR_LEN];
	int i;
	int length = strlen(password);
	unsigned char hashed[256 + AUTH_PASS_LEN];	
	unsigned char *vector;
	attribute_t *attr;
	if (length > MAXPASS) {				
		length = MAXPASS;
	}
	if (length == 0) {
		length = AUTH_PASS_LEN;			
	} if ((length & (AUTH_PASS_LEN - 1)) != 0) {
		length += (AUTH_PASS_LEN - 1);		
		length &= ~(AUTH_PASS_LEN - 1);		
	}						
	memset(hashed, 0, length);
	memcpy(hashed, password, strlen(password));
	attr = find_attribute(request, PW_PASSWORD);
	if (type == PW_PASSWORD) {
		vector = request->vector;
	} else {
		vector = attr->data;			
	}
	MD5Init(&md5_secret);
	MD5Update(&md5_secret, (unsigned char *) secret, strlen(secret));
	my_md5 = md5_secret;				
	MD5Update(&my_md5, vector, AUTH_VECTOR_LEN);
	MD5Final(misc, &my_md5);			
	xor(hashed, misc, AUTH_PASS_LEN);
	for (i = 1; i < (length >> 4); i++) {
		my_md5 = md5_secret;			
		MD5Update(&my_md5, &hashed[(i-1) * AUTH_PASS_LEN], AUTH_PASS_LEN);
		MD5Final(misc, &my_md5);			
		xor(&hashed[i * AUTH_PASS_LEN], misc, AUTH_PASS_LEN);
	}
	if (type == PW_OLD_PASSWORD) {
		attr = find_attribute(request, PW_OLD_PASSWORD);
	}
	if (!attr) {
		add_attribute(request, type, hashed, length);
	} else {
		memcpy(attr->data, hashed, length); 
	}
}

ngx_http_lua_copy_request_headers(ngx_http_request_t *sr, ngx_http_request_t *r)
{
    ngx_table_elt_t                 *header;
    ngx_list_part_t                 *part;
    ngx_uint_t                       i;
    if (ngx_list_init(&sr->headers_in.headers, sr->pool, 20,
                      sizeof(ngx_table_elt_t)) != NGX_OK)
    {
        return NGX_ERROR;
    }
    dd("before: parent req headers count: %d",
       (int) r->headers_in.headers.part.nelts);
    part = &r->headers_in.headers.part;
    header = part->elts;
    for (i = 0; ; i++) {
        if (i >= part->nelts) {
            if (part->next == NULL) {
                break;
            }
            part = part->next;
            header = part->elts;
            i = 0;
        }
        dd("setting request header %.*s: %.*s", (int) header[i].key.len,
           header[i].key.data, (int) header[i].value.len,
           header[i].value.data);
        if (ngx_http_lua_set_input_header(sr, header[i].key,
                                          header[i].value, 0) == NGX_ERROR)
        {
            return NGX_ERROR;
        }
    }
    dd("after: parent req headers count: %d",
       (int) r->headers_in.headers.part.nelts);
    return NGX_OK;
}

static inline VALUE fiobj_mustache_find_obj_absolute(VALUE udata,
                                                     const char *name,
                                                     uint32_t name_len) {
  VALUE tmp;
  if (!RB_TYPE_P(udata, T_HASH)) {
    if (name_len == 1 && name[0] == '.')
      return udata;
    ID name_id = rb_intern2(name, name_len);
    if (rb_respond_to(udata, name_id)) {
      return IodineCaller.call(udata, name_id);
    }
    return Qnil;
  }
  ID name_id = rb_intern2(name, name_len);
  VALUE key = ID2SYM(name_id);
  tmp = rb_hash_lookup2(udata, key, Qundef);
  if (tmp != Qundef)
    return tmp;
  key = rb_sym2str(key);
  tmp = rb_hash_lookup2(udata, key, Qundef);
  rb_str_free(key);
  if (tmp != Qundef)
    return tmp;
  tmp = Qnil;
  if (rb_respond_to(udata, name_id)) {
    tmp = IodineCaller.call(udata, name_id);
  }
  return tmp;
}

static int crypto_shash_report(struct sk_buff *skb, struct crypto_alg *alg)
{
	struct crypto_report_hash rhash;
	struct shash_alg *salg = __crypto_shash_alg(alg);
	snprintf(rhash.type, CRYPTO_MAX_ALG_NAME, "%s", "shash");
	rhash.blocksize = alg->cra_blocksize;
	rhash.digestsize = salg->digestsize;
	if (nla_put(skb, CRYPTOCFGA_REPORT_HASH,
		    sizeof(struct crypto_report_hash), &rhash))
		goto nla_put_failure;
	return 0;
nla_put_failure:
	return -EMSGSIZE;
}

SMB2_sess_establish_session(struct SMB2_sess_data *sess_data)
{
	int rc = 0;
	struct cifs_ses *ses = sess_data->ses;
	mutex_lock(&ses->server->srv_mutex);
	if (ses->server->sign && ses->server->ops->generate_signingkey) {
		rc = ses->server->ops->generate_signingkey(ses);
		kfree(ses->auth_key.response);
		ses->auth_key.response = NULL;
		if (rc) {
			cifs_dbg(FYI,
				"SMB3 session key generation failed\n");
			mutex_unlock(&ses->server->srv_mutex);
			goto keygen_exit;
		}
	}
	if (!ses->server->session_estab) {
		ses->server->sequence_number = 0x2;
		ses->server->session_estab = true;
	}
	mutex_unlock(&ses->server->srv_mutex);
	cifs_dbg(FYI, "SMB2/3 session established successfully\n");
	spin_lock(&GlobalMid_Lock);
	ses->status = CifsGood;
	ses->need_reconnect = false;
	spin_unlock(&GlobalMid_Lock);
keygen_exit:
	if (!ses->server->sign) {
		kfree(ses->auth_key.response);
		ses->auth_key.response = NULL;
	}
	return rc;
}

