    if (usersessionIt == sessionMap.end()){
      cout << "Bad session ID, redirecting to login." << endl;
      body = getLogin();
    } else
      uid = sessionMap[sessionId];
  }
  map<string, string> resHeaders;
  resHeaders["Server"] = "CSE461";
  resHeaders["Content-Type"] = "text/html; charset=UTF-8";
  if (uri.compare("/cal") == 0 && uid == -1) {
    cout << "login page" << endl;
    body = getLogin();
  } else if (uri.compare("/cal") == 0 && uid != -1) {
    cout << "cal page" << endl;
    string username = userNameById(uid);
    body = getHeader(username);
    body += getEmptyCalendar();
    body += getFooter();
  } else if (uri.compare("/getEvents") == 0 && uid != -1) {
    body = getEventsJson(uid);
    resHeaders["Content-Type"] = "application/json; charset=UTF-8";
  } else {
    cout << "error page" << endl;
    string message = "404 Page Not Found";
    return getResponseHeader("HTTP/1.1 404 Not Found", &resHeaders, body.size())
      + "\r\n" + message;
  }
  return getResponseHeader("HTTP/1.1 200 OK", &resHeaders, body.size()) + "\r\n" + body;
}

ConnectionManagerImpl::ActiveStream::~ActiveStream() {
  stream_info_.onRequestComplete();
  if (!stream_info_.hasAnyResponseFlag() && !stream_info_.responseCode()) {
    stream_info_.setResponseFlag(StreamInfo::ResponseFlag::DownstreamConnectionTermination);
  }
  connection_manager_.stats_.named_.downstream_rq_active_.dec();
  if (request_headers_ != nullptr) {
    request_headers_->refreshByteSize();
  }
  if (response_headers_ != nullptr) {
    response_headers_->refreshByteSize();
  }
  if (response_trailers_ != nullptr) {
    response_trailers_->refreshByteSize();
  }
  for (const AccessLog::InstanceSharedPtr& access_log : connection_manager_.config_.accessLogs()) {
    access_log->log(request_headers_.get(), response_headers_.get(), response_trailers_.get(),
                    stream_info_);
  }
  for (const auto& log_handler : access_log_handlers_) {
    log_handler->log(request_headers_.get(), response_headers_.get(), response_trailers_.get(),
                     stream_info_);
  }
  if (stream_info_.healthCheck()) {
    connection_manager_.config_.tracingStats().health_check_.inc();
  }
  if (active_span_) {
    Tracing::HttpTracerUtility::finalizeDownstreamSpan(
        *active_span_, request_headers_.get(), response_headers_.get(), response_trailers_.get(),
        stream_info_, *this);
  }
  if (state_.successful_upgrade_) {
    connection_manager_.stats_.named_.downstream_cx_upgrades_active_.dec();
  }
  ASSERT(state_.filter_call_state_ == 0);
}

int URI_FUNC(ComposeQueryEngine)(URI_CHAR * dest,
		const URI_TYPE(QueryList) * queryList,
		int maxChars, int * charsWritten, int * charsRequired,
		UriBool spaceToPlus, UriBool normalizeBreaks) {
	UriBool firstItem = URI_TRUE;
	int ampersandLen = 0;  
	URI_CHAR * write = dest;
	if (dest == NULL) {
		*charsRequired = 0;
	} else {
		maxChars--;
	}
	while (queryList != NULL) {
		const URI_CHAR * const key = queryList->key;
		const URI_CHAR * const value = queryList->value;
		const int worstCase = (normalizeBreaks == URI_TRUE ? 6 : 3);
		const int keyLen = (key == NULL) ? 0 : (int)URI_STRLEN(key);
		const int keyRequiredChars = worstCase * keyLen;
		const int valueLen = (value == NULL) ? 0 : (int)URI_STRLEN(value);
		const int valueRequiredChars = worstCase * valueLen;
		if (dest == NULL) {
			(*charsRequired) += ampersandLen + keyRequiredChars + ((value == NULL)
						? 0
						: 1 + valueRequiredChars);
			if (firstItem == URI_TRUE) {
				ampersandLen = 1;
				firstItem = URI_FALSE;
			}
		} else {
			if ((write - dest) + ampersandLen + keyRequiredChars > maxChars) {
				return URI_ERROR_OUTPUT_TOO_LARGE;
			}
			if (firstItem == URI_TRUE) {
				ampersandLen = 1;
				firstItem = URI_FALSE;
			} else {
				write[0] = _UT('&');
				write++;
			}
			write = URI_FUNC(EscapeEx)(key, key + keyLen,
					write, spaceToPlus, normalizeBreaks);
			if (value != NULL) {
				if ((write - dest) + 1 + valueRequiredChars > maxChars) {
					return URI_ERROR_OUTPUT_TOO_LARGE;
				}
				write[0] = _UT('=');
				write++;
				write = URI_FUNC(EscapeEx)(value, value + valueLen,
						write, spaceToPlus, normalizeBreaks);
			}
		}
		queryList = queryList->next;
	}
	if (dest != NULL) {
		write[0] = _UT('\0');
		if (charsWritten != NULL) {
			*charsWritten = (int)(write - dest) + 1; 
		}
	}
	return URI_SUCCESS;
}

int nfc_deactivate_target(struct nfc_dev *dev, u32 target_idx, u8 mode)
{
	int rc = 0;
	pr_debug("dev_name=%s target_idx=%u\n",
		 dev_name(&dev->dev), target_idx);
	device_lock(&dev->dev);
	if (!device_is_registered(&dev->dev)) {
		rc = -ENODEV;
		goto error;
	}
	if (dev->active_target == NULL) {
		rc = -ENOTCONN;
		goto error;
	}
	if (dev->active_target->idx != target_idx) {
		rc = -ENOTCONN;
		goto error;
	}
	if (dev->ops->check_presence)
		del_timer_sync(&dev->check_pres_timer);
	dev->ops->deactivate_target(dev, dev->active_target, mode);
	dev->active_target = NULL;
error:
	device_unlock(&dev->dev);
	return rc;
}

