Status ValidateInputsGenerateOutputs(
    OpKernelContext* ctx, const Tensor** inputs, const Tensor** seq_len,
    Tensor** log_prob, OpOutputList* decoded_indices,
    OpOutputList* decoded_values, OpOutputList* decoded_shape) const {
  Status status = ctx->input("inputs", inputs);
  if (!status.ok()) return status;
  status = ctx->input("sequence_length", seq_len);
  if (!status.ok()) return status;
  const TensorShape& inputs_shape = (*inputs)->shape();
  if (inputs_shape.dims() != 3) {
    return errors::InvalidArgument("inputs is not a 3-Tensor");
  }
  if (inputs_shape.num_elements() == 0) {
    return errors::InvalidArgument("inputs must not be empty");
  }
  const int64 max_time = inputs_shape.dim_size(0);
  const int64 batch_size = inputs_shape.dim_size(1);
  if (max_time == 0) {
    return errors::InvalidArgument("max_time is 0");
  }
  if (!TensorShapeUtils::IsVector((*seq_len)->shape())) {
    return errors::InvalidArgument("sequence_length is not a vector");
  }
  if (!(batch_size == (*seq_len)->dim_size(0))) {
    return errors::FailedPrecondition(
        "len(sequence_length) != batch_size.  ",
        "len(sequence_length):  ", (*seq_len)->dim_size(0),
        " batch_size: ", batch_size);
  }
  auto seq_len_t = (*seq_len)->vec<int32>();
  for (int b = 0; b < batch_size; ++b) {
    if (!(seq_len_t(b) <= max_time)) {
      return errors::FailedPrecondition("sequence_length(", b,
                                        ") <= ", max_time);
    }
  }
  Status s = ctx->allocate_output(
      "log_probability", TensorShape({batch_size, top_paths_}), log_prob);
  if (!s.ok()) return s;
  s = ctx->output_list("decoded_indices", decoded_indices);
  if (!s.ok()) return s;
  s = ctx->output_list("decoded_values", decoded_values);
  if (!s.ok()) return s;
  s = ctx->output_list("decoded_shape", decoded_shape);
  if (!s.ok()) return s;
  return Status::OK();
}

static void parse_relocation_info(struct MACH0_(obj_t) *bin, RSkipList *relocs, ut32 offset, ut32 num) {
	if (!num || !offset || (st32)num < 0) {
		return;
	}
	ut64 total_size = num * sizeof (struct relocation_info);
	if (offset > bin->size) {
		return;
	}
	if (total_size > bin->size) {
		total_size = bin->size - offset;
		num = total_size /= sizeof (struct relocation_info);
	}
	struct relocation_info *info = calloc (num, sizeof (struct relocation_info));
	if (!info) {
		return;
	}
	if (r_buf_read_at (bin->b, offset, (ut8 *) info, total_size) < total_size) {
		free (info);
		return;
	}
	size_t i;
	for (i = 0; i < num; i++) {
		struct relocation_info a_info = info[i];
		ut32 sym_num = a_info.r_symbolnum;
		if (sym_num > bin->nsymtab) {
			continue;
		}
		ut32 stridx = bin->symtab[sym_num].n_strx;
		char *sym_name = get_name (bin, stridx, false);
		if (!sym_name) {
			continue;
		}
		struct reloc_t *reloc = R_NEW0 (struct reloc_t);
		if (!reloc) {
			free (info);
			free (sym_name);
			return;
		}
		reloc->addr = offset_to_vaddr (bin, a_info.r_address);
		reloc->offset = a_info.r_address;
		reloc->ord = sym_num;
		reloc->type = a_info.r_type; 
		reloc->external = a_info.r_extern;
		reloc->pc_relative = a_info.r_pcrel;
		reloc->size = a_info.r_length;
		r_str_ncpy (reloc->name, sym_name, sizeof (reloc->name) - 1);
		r_skiplist_insert (relocs, reloc);
		free (sym_name);
	}
	free (info);
}

rpl_daoack_print(netdissect_options *ndo,
                 const u_char *bp, u_int length)
{
        const struct nd_rpl_daoack *daoack = (const struct nd_rpl_daoack *)bp;
        const char *dagid_str = "<elided>";
