wsemul_vt100_output_csi(struct wsemul_vt100_emuldata *edp,
    struct wsemul_inputstate *instate)
{
	u_int newstate = VT100_EMUL_STATE_CSI;
	int oargs;
	int rc = 0;
	switch (instate->inchar) {
	case '0': case '1': case '2': case '3': case '4':
	case '5': case '6': case '7': case '8': case '9':
		if (edp->nargs > VT100_EMUL_NARGS - 1)
			break;
		edp->args[edp->nargs] = (edp->args[edp->nargs] * 10) +
		    (instate->inchar - '0');
		break;
	case ';': 
		edp->nargs++;
		break;
	case '?': 
	case '>': 
		edp->modif1 = (char)instate->inchar;
		break;
	case '!':
	case '"':
	case '$':
	case '&':
		edp->modif2 = (char)instate->inchar;
		break;
	default: 
		oargs = edp->nargs++;
		if (edp->nargs > VT100_EMUL_NARGS) {
#ifdef VT100_DEBUG
			printf("vt100: too many arguments\n");
#endif
			edp->nargs = VT100_EMUL_NARGS;
		}
		rc = wsemul_vt100_handle_csi(edp, instate);
		if (rc != 0) {
			edp->nargs = oargs;
			return rc;
		}
		newstate = VT100_EMUL_STATE_NORMAL;
		break;
	}
	if (COLS_LEFT != 0)
		edp->flags &= ~VTFL_LASTCHAR;
	edp->state = newstate;
	return 0;
}

static void __reg_combine_min_max(struct bpf_reg_state *src_reg,
				  struct bpf_reg_state *dst_reg)
{
	src_reg->umin_value = dst_reg->umin_value = max(src_reg->umin_value,
							dst_reg->umin_value);
	src_reg->umax_value = dst_reg->umax_value = min(src_reg->umax_value,
							dst_reg->umax_value);
	src_reg->smin_value = dst_reg->smin_value = max(src_reg->smin_value,
							dst_reg->smin_value);
	src_reg->smax_value = dst_reg->smax_value = min(src_reg->smax_value,
							dst_reg->smax_value);
	src_reg->var_off = dst_reg->var_off = tnum_intersect(src_reg->var_off,
							     dst_reg->var_off);
	__update_reg_bounds(src_reg);
	__update_reg_bounds(dst_reg);
	__reg_deduce_bounds(src_reg);
	__reg_deduce_bounds(dst_reg);
	__reg_bound_offset(src_reg);
	__reg_bound_offset(dst_reg);
	__update_reg_bounds(src_reg);
	__update_reg_bounds(dst_reg);
}

static long madvise_remove(struct vm_area_struct *vma,
				struct vm_area_struct **prev,
				unsigned long start, unsigned long end)
{
	loff_t offset;
	int error;
	*prev = NULL;	
	if (vma->vm_flags & (VM_LOCKED|VM_NONLINEAR|VM_HUGETLB))
		return -EINVAL;
	if (!vma->vm_file || !vma->vm_file->f_mapping
		|| !vma->vm_file->f_mapping->host) {
			return -EINVAL;
	}
	if ((vma->vm_flags & (VM_SHARED|VM_WRITE)) != (VM_SHARED|VM_WRITE))
		return -EACCES;
	offset = (loff_t)(start - vma->vm_start)
			+ ((loff_t)vma->vm_pgoff << PAGE_SHIFT);
	up_read(&current->mm->mmap_sem);
	error = do_fallocate(vma->vm_file,
				FALLOC_FL_PUNCH_HOLE | FALLOC_FL_KEEP_SIZE,
				offset, end - start);
	down_read(&current->mm->mmap_sem);
	return error;
}

void Compute(OpKernelContext* context) override {
  CHECK_EQ(4, context->num_inputs());
  const Tensor& gradient = context->input(0);
  const Tensor& input = context->input(1);
  OP_REQUIRES(context, input.IsSameSize(gradient),
              InvalidArgument("gradient and input must be the same size"));
  const Tensor& min = context->input(2);
  const Tensor& max = context->input(3);
  OP_REQUIRES(
      context, TensorShapeUtils::IsScalar(min.shape()),
      InvalidArgument("`min` must be rank 0 but is rank ", min.dims()));
  OP_REQUIRES(
      context, TensorShapeUtils::IsScalar(max.shape()),
      InvalidArgument("`max` must be rank 0 but is rank ", max.dims()));
  Tensor* grad_wrt_input;
  OP_REQUIRES_OK(context,
                 context->allocate_output(0, input.shape(), &grad_wrt_input));
  TensorShape scalar_shape;
  Tensor* grad_wrt_min;
  OP_REQUIRES_OK(context,
                 context->allocate_output(1, scalar_shape, &grad_wrt_min));
  Tensor* grad_wrt_max;
  OP_REQUIRES_OK(context,
                 context->allocate_output(2, scalar_shape, &grad_wrt_max));
  FakeQuantWithMinMaxVarsGradientFunctor<Device> functor;
  functor(context->eigen_device<Device>(), gradient.flat<float>(),
          input.flat<float>(), min.scalar<float>(), max.scalar<float>(),
          quant_min_, quant_max_, grad_wrt_input->flat<float>(),
          grad_wrt_min->scalar<float>(), grad_wrt_max->scalar<float>());
}

