mesh_state_cleanup(struct mesh_state* mstate)
{
	struct mesh_area* mesh;
	int i;
	if(!mstate)
		return;
	mesh = mstate->s.env->mesh;
	if(mstate->s.serve_expired_data && mstate->s.serve_expired_data->timer) {
		comm_timer_delete(mstate->s.serve_expired_data->timer);
		mstate->s.serve_expired_data->timer = NULL;
	}
	if(!mstate->replies_sent) {
		struct mesh_reply* rep = mstate->reply_list;
		struct mesh_cb* cb;
		mstate->reply_list = NULL;
		for(; rep; rep=rep->next) {
			infra_wait_limit_dec(mesh->env->infra_cache,
				&rep->query_reply, mesh->env->cfg);
			comm_point_drop_reply(&rep->query_reply);
			log_assert(mesh->num_reply_addrs > 0);
			mesh->num_reply_addrs--;
		}
		while((cb = mstate->cb_list)!=NULL) {
			mstate->cb_list = cb->next;
			fptr_ok(fptr_whitelist_mesh_cb(cb->cb));
			(*cb->cb)(cb->cb_arg, LDNS_RCODE_SERVFAIL, NULL,
				sec_status_unchecked, NULL, 0);
			log_assert(mesh->num_reply_addrs > 0);
			mesh->num_reply_addrs--;
		}
	}
	for(i=0; i<mesh->mods.num; i++) {
		fptr_ok(fptr_whitelist_mod_clear(mesh->mods.mod[i]->clear));
		(*mesh->mods.mod[i]->clear)(&mstate->s, i);
		mstate->s.minfo[i] = NULL;
		mstate->s.ext_state[i] = module_finished;
	}
	alloc_reg_release(mstate->s.env->alloc, mstate->s.region);
}

void Compute(OpKernelContext* const context) override {
  const Tensor* node_ids_t;
  OP_REQUIRES_OK(context, context->input("node_ids", &node_ids_t));
  const auto node_ids = node_ids_t->vec<int32>();
  const Tensor* gradients_t;
  OP_REQUIRES_OK(context, context->input("gradients", &gradients_t));
  const auto gradients = gradients_t->matrix<float>();
  OP_REQUIRES(
      context, node_ids.size() == gradients.dimension(0),
      errors::InvalidArgument(
          "node_ids size should match 0th dim of gradients. node ids "
          "size: ",
          node_ids.size(), ", gradients dim0: ", gradients.dimension(0)));
  const Tensor* hessians_t;
  OP_REQUIRES_OK(context, context->input("hessians", &hessians_t));
  const auto hessians = hessians_t->matrix<float>();
  OpInputList bucketized_features_list;
  OP_REQUIRES_OK(context, context->input_list("bucketized_features_list",
                                              &bucketized_features_list));
  const int64_t batch_size = node_ids_t->dim_size(0);
  Tensor temp_stats_double_t;
  OP_REQUIRES_OK(context, context->allocate_temp(
                              DT_DOUBLE,
                              {num_features_, max_splits_, num_buckets_, 2},
                              &temp_stats_double_t));
  auto temp_stats_double = temp_stats_double_t.tensor<double, 4>();
  temp_stats_double.setZero();
  for (int feature_idx = 0; feature_idx < num_features_; ++feature_idx) {
    const auto& features = bucketized_features_list[feature_idx].vec<int32>();
    for (int i = 0; i < batch_size; ++i) {
      const int32_t node = node_ids(i);
      const int32_t bucket = features(i);
      temp_stats_double(feature_idx, node, bucket, 0) += gradients(i, 0);
      temp_stats_double(feature_idx, node, bucket, 1) += hessians(i, 0);
    }
  }
  Tensor* output_stats_summary_t = nullptr;
  OP_REQUIRES_OK(context, context->allocate_output(
                              "stats_summary", temp_stats_double_t.shape(),
                              &output_stats_summary_t));
  output_stats_summary_t->tensor<float, 4>() =
      temp_stats_double.template cast<float>();
}

getprivs_ret * get_privs_2_svc(krb5_ui_4 *arg, struct svc_req *rqstp)
{
    static getprivs_ret            ret;
    gss_buffer_desc                client_name, service_name;
    OM_uint32                      minor_stat;
    kadm5_server_handle_t          handle;
    const char                     *errmsg = NULL;
    xdr_free(xdr_getprivs_ret, &ret);
    if ((ret.code = new_server_handle(*arg, rqstp, &handle)))
        goto exit_func;
    if ((ret.code = check_handle((void *)handle)))
        goto exit_func;
    ret.api_version = handle->api_version;
    if (setup_gss_names(rqstp, &client_name, &service_name) < 0) {
        ret.code = KADM5_FAILURE;
        goto exit_func;
    }
    ret.code = kadm5_get_privs((void *)handle, &ret.privs);
    if( ret.code != 0 )
        errmsg = krb5_get_error_message(handle->context, ret.code);
    log_done("kadm5_get_privs", client_name.value, errmsg,
             &client_name, &service_name, rqstp);
    if (errmsg != NULL)
        krb5_free_error_message(handle->context, errmsg);
    gss_release_buffer(&minor_stat, &client_name);
    gss_release_buffer(&minor_stat, &service_name);
exit_func:
    free_server_handle(handle);
    return &ret;
}

static int zerocopy_sg_from_iovec(struct sk_buff *skb, const struct iovec *from,
				  int offset, size_t count)
{
	int len = iov_length(from, count) - offset;
	int copy = skb_headlen(skb);
	int size, offset1 = 0;
	int i = 0;
	while (count && (offset >= from->iov_len)) {
		offset -= from->iov_len;
		++from;
		--count;
	}
	while (count && (copy > 0)) {
		size = min_t(unsigned int, copy, from->iov_len - offset);
		if (copy_from_user(skb->data + offset1, from->iov_base + offset,
				   size))
			return -EFAULT;
		if (copy > size) {
			++from;
			--count;
			offset = 0;
		} else
			offset += size;
		copy -= size;
		offset1 += size;
	}
	if (len == offset1)
		return 0;
	while (count--) {
		struct page *page[MAX_SKB_FRAGS];
		int num_pages;
		unsigned long base;
		unsigned long truesize;
		len = from->iov_len - offset;
		if (!len) {
			offset = 0;
			++from;
			continue;
		}
		base = (unsigned long)from->iov_base + offset;
		size = ((base & ~PAGE_MASK) + len + ~PAGE_MASK) >> PAGE_SHIFT;
		num_pages = get_user_pages_fast(base, size, 0, &page[i]);
		if ((num_pages != size) ||
		    (num_pages > MAX_SKB_FRAGS - skb_shinfo(skb)->nr_frags)) {
			for (i = 0; i < num_pages; i++)
				put_page(page[i]);
			return -EFAULT;
		}
		truesize = size * PAGE_SIZE;
		skb->data_len += len;
		skb->len += len;
		skb->truesize += truesize;
		atomic_add(truesize, &skb->sk->sk_wmem_alloc);
		while (len) {
			int off = base & ~PAGE_MASK;
			int size = min_t(int, len, PAGE_SIZE - off);
			__skb_fill_page_desc(skb, i, page[i], off, size);
			skb_shinfo(skb)->nr_frags++;
			base += size;
			len -= size;
			i++;
		}
		offset = 0;
		++from;
	}
	return 0;
}

    FIO_NAME(_find_map_pos_)(FIO_NAME(s) * set, FIO_SET_HASH_TYPE hash_value,
                             FIO_SET_TYPE obj) {
  if (FIO_SET_HASH_COMPARE(hash_value, FIO_SET_HASH_INVALID))
    hash_value = FIO_SET_HASH_FORCE;
  if (set->map) {
    if (set->has_collisions && set->pos != set->count) {
      FIO_NAME(rehash)(set);
    }
    size_t full_collisions_counter = 0;
    FIO_NAME(_map_s_) * pos;
    const uintptr_t mask = (1ULL << set->used_bits) - 1;
    uintptr_t i;
    const uintptr_t hash_value_i = FIO_SET_HASH2UINTPTR(hash_value, 0);
    uintptr_t hash_alt = FIO_SET_HASH2UINTPTR(hash_value, set->used_bits);
    pos = set->map + (hash_alt & mask);
    if (FIO_SET_HASH_COMPARE(FIO_SET_HASH_INVALID, pos->hash))
      return pos;
    if (FIO_SET_HASH_COMPARE(pos->hash, hash_value_i)) {
      if (!pos->pos || FIO_SET_COMPARE(pos->pos->obj, obj))
        return pos;
      set->has_collisions = 1;
      ++full_collisions_counter;
    }
    i = 0;
    const uintptr_t limit =
        FIO_SET_CUCKOO_STEPS * (set->capa > (FIO_SET_MAX_MAP_SEEK << 2)
                                    ? FIO_SET_MAX_MAP_SEEK
                                    : (set->capa >> 2));
    while (i < limit) {
      i += FIO_SET_CUCKOO_STEPS;
      pos = set->map + ((hash_alt + i) & mask);
      if (FIO_SET_HASH_COMPARE(FIO_SET_HASH_INVALID, pos->hash))
        return pos;
      if (FIO_SET_HASH_COMPARE(pos->hash, hash_value_i)) {
        if (!pos->pos || FIO_SET_COMPARE(pos->pos->obj, obj))
          return pos;
        set->has_collisions = 1;
        if (++full_collisions_counter >= FIO_SET_MAX_MAP_FULL_COLLISIONS) {
          FIO_LOG_WARNING(
              "(fio hash map) too many full collisions - under attack?");
          set->under_attack = 1;
        }
        if (set->under_attack) {
          return pos;
        }
      }
    }
  }
  return NULL;
  (void)obj; 
}

