static int adpt_close(struct inode *inode, struct file *file)
{
	int minor;
	adpt_hba* pHba;
	minor = iminor(inode);
	if (minor >= hba_count) {
		return -ENXIO;
	}
	mutex_lock(&adpt_configuration_lock);
	for (pHba = hba_chain; pHba; pHba = pHba->next) {
		if (pHba->unit == minor) {
			break;	
		}
	}
	mutex_unlock(&adpt_configuration_lock);
	if (pHba == NULL) {
		return -ENXIO;
	}
	pHba->in_use = 0;
	return 0;
}

void hexdump(msg_info msg_info, const char *mem, unsigned int len)
{
    unsigned int i, j;
    char str[10 + HEXDUMP_COLS * 4 + 2];
    int c = 0; 
    for(i = 0; i < len + ((len % HEXDUMP_COLS) ? (HEXDUMP_COLS - len % HEXDUMP_COLS) : 0); i++)
    {
        if(i % HEXDUMP_COLS == 0)
            c += sprintf(&str[c], "0x%06x: ", i);
        if(i < len)
            c += sprintf(&str[c], "%02x ", 0xFF & mem[i]);
        else 
            c+= sprintf(&str[c], "   ");
        if(i % HEXDUMP_COLS == (HEXDUMP_COLS - 1)) {
            for(j = i - (HEXDUMP_COLS - 1); j <= i; j++) {
                if(j >= len) 
                    str[c++] = ' ';
                else if(isprint(mem[j])) 
                    str[c++] = 0xFF & mem[j];
                else 
                    str[c++] = '.';
            }
            str[c++] = '\n';
            str[c++] = 0;
            print_message(msg_info, str);
            c = 0;
        }
    }
}

CBORTag_hash(CBORTagObject *self)
{
    if (!_CBOR2_thread_locals && _CBOR2_init_thread_locals() == -1)
        return -1;
    Py_hash_t ret = -1;
    PyObject *running_hashes = NULL;
    PyObject *tmp = NULL;
    PyObject *self_id = PyLong_FromVoidPtr(self);
    if (!self_id)
        goto exit;
    running_hashes = PyObject_GetAttrString(_CBOR2_thread_locals, "running_hashes");
    if (!running_hashes) {
        PyErr_Clear();
        running_hashes = PySet_New(NULL);
        if (PyObject_SetAttrString(_CBOR2_thread_locals, "running_hashes", running_hashes) == -1)
            goto exit;
    } else {
        switch (PySet_Contains(running_hashes, self_id)) {
            case -1:  
                goto exit;
            case 1:  
                PyErr_SetString(
                    PyExc_RuntimeError,
                    "This CBORTag is not hashable because it contains a reference to itself"
                );
                goto exit;
        }
    }
    if (PySet_Add(running_hashes, self_id) == -1)
        goto exit;
    tmp = Py_BuildValue("(KO)", self->tag, self->value);
    if (!tmp)
        goto exit;
    ret = PyObject_Hash(tmp);
    if (ret == -1)
        goto exit;
    if (PySet_Discard(running_hashes, self_id) == -1) {
        ret = -1;
        goto exit;
    }
    Py_ssize_t length = PySequence_Length(running_hashes);
    if (length == -1) {
        ret = -1;
        goto exit;
    }
    if (length == 0 && PyObject_DelAttrString(_CBOR2_thread_locals, "running_hashes") == -1) {
        ret = -1;
        goto exit;
    }
exit:
    Py_CLEAR(self_id);
    Py_CLEAR(running_hashes);
    Py_CLEAR(tmp);
    return ret;
}

void Compute(OpKernelContext* context) override {
  const Tensor& input_sizes = context->input(0);
  const Tensor& filter = context->input(1);
  const Tensor& out_backprop = context->input(2);
  TensorShape input_shape;
  OP_REQUIRES_OK(context,
                 Conv2DBackpropComputeInputShape(input_sizes, filter.shape(),
                                                 out_backprop.shape(),
                                                 data_format_, &input_shape));
  Tensor* in_backprop = nullptr;
  OP_REQUIRES_OK(context,
                 context->allocate_output(0, input_shape, &in_backprop));
  if (input_shape.num_elements() == 0) {
    return;
  }
  if (out_backprop.NumElements() == 0) {
    functor::SetZeroFunctor<Device, T> set_zero;
    set_zero(context->eigen_device<Device>(),
             in_backprop->template flat<T>());
    return;
  }
  const int stride_rows = GetTensorDim(strides_, data_format_, 'H');
  const int stride_cols = GetTensorDim(strides_, data_format_, 'W');
  const int dilation_rows = GetTensorDim(dilations_, data_format_, 'H');
  const int dilation_cols = GetTensorDim(dilations_, data_format_, 'W');
  VLOG(2) << "Conv2DBackpropInput:"
          << " input: " << input_shape.DebugString()
          << " filter:" << filter.shape().DebugString()
          << " out_backprop: " << out_backprop.shape().DebugString()
          << " strides: [" << stride_rows << ", " << stride_cols << "]"
          << " dilations: [" << dilation_rows << ", " << dilation_cols << "]";
  LaunchConv2DBackpropInputOp<Device, T> launch;
  launch(context, use_cudnn_, cudnn_use_autotune_, out_backprop, filter,
         dilation_rows, dilation_cols, stride_rows, stride_cols, padding_,
         explicit_paddings_, in_backprop, data_format_);
}

__be32 ipv6_proxy_select_ident(struct net *net, struct sk_buff *skb)
