long keyctl_set_reqkey_keyring(int reqkey_defl)
{
	struct cred *new;
	int ret, old_setting;
	old_setting = current_cred_xxx(jit_keyring);
	if (reqkey_defl == KEY_REQKEY_DEFL_NO_CHANGE)
		return old_setting;
	new = prepare_creds();
	if (!new)
		return -ENOMEM;
	switch (reqkey_defl) {
	case KEY_REQKEY_DEFL_THREAD_KEYRING:
		ret = install_thread_keyring_to_cred(new);
		if (ret < 0)
			goto error;
		goto set;
	case KEY_REQKEY_DEFL_PROCESS_KEYRING:
		ret = install_process_keyring_to_cred(new);
		if (ret < 0) {
			if (ret != -EEXIST)
				goto error;
			ret = 0;
		}
		goto set;
	case KEY_REQKEY_DEFL_DEFAULT:
	case KEY_REQKEY_DEFL_SESSION_KEYRING:
	case KEY_REQKEY_DEFL_USER_KEYRING:
	case KEY_REQKEY_DEFL_USER_SESSION_KEYRING:
	case KEY_REQKEY_DEFL_REQUESTOR_KEYRING:
		goto set;
	case KEY_REQKEY_DEFL_NO_CHANGE:
	case KEY_REQKEY_DEFL_GROUP_KEYRING:
	default:
		ret = -EINVAL;
		goto error;
	}
set:
	new->jit_keyring = reqkey_defl;
	commit_creds(new);
	return old_setting;
error:
	abort_creds(new);
	return ret;
}

Value sendrawtransaction(const Array& params, bool fHelp)
{
    if (fHelp || params.size() < 1 || params.size() > 1)
        throw runtime_error(
            "sendrawtransaction <hex string>\n"
            "Submits raw transaction (serialized, hex-encoded) to local node and network.");
    RPCTypeCheck(params, list_of(str_type));
    vector<unsigned char> txData(ParseHex(params[0].get_str()));
    CDataStream ssData(txData, SER_NETWORK, PROTOCOL_VERSION);
    CTransaction tx;
    try {
        ssData >> tx;
    }
    catch (std::exception &e) {
        throw JSONRPCError(-22, "TX decode failed");
    }
    uint256 hashTx = tx.GetHash();
    CTransaction existingTx;
    uint256 hashBlock = 0;
    if (GetTransaction(hashTx, existingTx, hashBlock))
    {
        if (hashBlock != 0)
            throw JSONRPCError(-5, string("transaction already in block ")+hashBlock.GetHex());
    }
    else
    {
        CTxDB txdb("r");
        if (!tx.AcceptToMemoryPool(txdb))
            throw JSONRPCError(-22, "TX rejected");
        SyncWithWallets(tx, NULL, true);
    }
    RelayMessage(CInv(MSG_TX, hashTx), tx);
    return hashTx.GetHex();
}

static int setup_dev_console(const struct lxc_rootfs *rootfs,
			 const struct lxc_console *console)
{
	char path[MAXPATHLEN];
	struct stat s;
	int ret;
	ret = snprintf(path, sizeof(path), "%s/dev/console", rootfs->mount);
	if (ret >= sizeof(path)) {
		ERROR("console path too long");
		return -1;
	}
	if (access(path, F_OK)) {
		WARN("rootfs specified but no console found at '%s'", path);
		return 0;
	}
	if (console->master < 0) {
		INFO("no console");
		return 0;
	}
	if (stat(path, &s)) {
		SYSERROR("failed to stat '%s'", path);
		return -1;
	}
	if (chmod(console->name, s.st_mode)) {
		SYSERROR("failed to set mode '0%o' to '%s'",
			 s.st_mode, console->name);
		return -1;
	}
	if (mount(console->name, path, "none", MS_BIND, 0)) {
		ERROR("failed to mount '%s' on '%s'", console->name, path);
		return -1;
	}
	INFO("console has been setup");
	return 0;
}

void Compute(OpKernelContext* const context) override {
  core::RefCountPtr<BoostedTreesEnsembleResource> resource;
  OP_REQUIRES_OK(context, LookupResource(context, HandleFromInput(context, 0),
                                         &resource));
  OpInputList bucketized_features_list;
  OP_REQUIRES_OK(context, context->input_list("bucketized_features",
                                              &bucketized_features_list));
  std::vector<tensorflow::TTypes<int32>::ConstMatrix> bucketized_features;
  bucketized_features.reserve(bucketized_features_list.size());
  ConvertVectorsToMatrices(bucketized_features_list, bucketized_features);
  const int batch_size = bucketized_features[0].dimension(0);
  Tensor* output_logits_t = nullptr;
  OP_REQUIRES_OK(context, context->allocate_output(
                              "logits", {batch_size, logits_dimension_},
                              &output_logits_t));
  auto output_logits = output_logits_t->matrix<float>();
  if (resource->num_trees() <= 0) {
    output_logits.setZero();
    return;
  }
  const int32 last_tree = resource->num_trees() - 1;
  auto do_work = [&resource, &bucketized_features, &output_logits, last_tree,
                  this](int32 start, int32 end) {
    for (int32 i = start; i < end; ++i) {
      std::vector<float> tree_logits(logits_dimension_, 0.0);
      int32 tree_id = 0;
      int32 node_id = 0;
      while (true) {
        if (resource->is_leaf(tree_id, node_id)) {
          const float tree_weight = resource->GetTreeWeight(tree_id);
          const auto& leaf_logits = resource->node_value(tree_id, node_id);
          DCHECK_EQ(leaf_logits.size(), logits_dimension_);
          for (int32 j = 0; j < logits_dimension_; ++j) {
            tree_logits[j] += tree_weight * leaf_logits[j];
          }
          if (tree_id == last_tree) {
            break;
          }
          ++tree_id;
          node_id = 0;
        } else {
          node_id =
              resource->next_node(tree_id, node_id, i, bucketized_features);
        }
      }
      for (int32 j = 0; j < logits_dimension_; ++j) {
        output_logits(i, j) = tree_logits[j];
      }
    }
  };
  const int64 cost = (last_tree + 1) * 10;
  thread::ThreadPool* const worker_threads =
      context->device()->tensorflow_cpu_worker_threads()->workers;
  Shard(worker_threads->NumThreads(), worker_threads, batch_size,
        cost, do_work);
}

absl::Status IsSupported(const TfLiteContext* context,
                         const TfLiteNode* tflite_node,
                         const TfLiteRegistration* registration) final {
  if (mirror_pad_) {
    const TfLiteMirrorPaddingParams* tf_options;
    RETURN_IF_ERROR(RetrieveBuiltinData(tflite_node, &tf_options));
    if (tf_options->mode !=
        TfLiteMirrorPaddingMode::kTfLiteMirrorPaddingReflect) {
      return absl::InvalidArgumentError(
          "Only Reflective padding is supported for Mirror Pad operation.");
    }
  }
  RETURN_IF_ERROR(CheckMaxSupportedOpVersion(registration, 2));
  RETURN_IF_ERROR(CheckInputsOutputs(context, tflite_node,
                                     1, 1));
  RETURN_IF_ERROR(CheckTensorIsAvailable(context, tflite_node, 1));
  auto pad_tensor = tflite::GetInput(context, tflite_node, 1);
  if (pad_tensor->dims->size != 2) {
    return absl::InvalidArgumentError(absl::StrCat(
        "Invalid paddings tensor dimension: expected 2 dim, got ",
        pad_tensor->dims->size, " dim"));
  }
  bool supported =
      pad_tensor->dims->data[0] == 3 || pad_tensor->dims->data[0] == 4;
  if (!supported || pad_tensor->dims->data[1] != 2) {
    return absl::InvalidArgumentError(absl::StrCat(
        "Invalid paddings tensor shape: expected 4x2 or 3x2, got ",
        pad_tensor->dims->data[0], "x", pad_tensor->dims->data[1]));
  }
  return absl::OkStatus();
}

static int em_ret_far(struct x86_emulate_ctxt *ctxt)
{
	int rc;
	unsigned long eip, cs;
	u16 old_cs;
	int cpl = ctxt->ops->cpl(ctxt);
	struct desc_struct old_desc, new_desc;
	const struct x86_emulate_ops *ops = ctxt->ops;
	if (ctxt->mode == X86EMUL_MODE_PROT64)
		ops->get_segment(ctxt, &old_cs, &old_desc, NULL,
				 VCPU_SREG_CS);
	rc = emulate_pop(ctxt, &eip, ctxt->op_bytes);
	if (rc != X86EMUL_CONTINUE)
		return rc;
	rc = emulate_pop(ctxt, &cs, ctxt->op_bytes);
	if (rc != X86EMUL_CONTINUE)
		return rc;
	if (ctxt->mode >= X86EMUL_MODE_PROT16 && (cs & 3) > cpl)
		return X86EMUL_UNHANDLEABLE;
	rc = __load_segment_descriptor(ctxt, (u16)cs, VCPU_SREG_CS, cpl,
				       X86_TRANSFER_RET,
				       &new_desc);
	if (rc != X86EMUL_CONTINUE)
		return rc;
	rc = assign_eip_far(ctxt, eip, &new_desc);
	if (rc != X86EMUL_CONTINUE) {
		WARN_ON(ctxt->mode != X86EMUL_MODE_PROT64);
		ops->set_segment(ctxt, old_cs, &old_desc, 0, VCPU_SREG_CS);
	}
	return rc;
}

