		u64 ts = gf_filter_pck_get_cts(pck);
		if (ts != GF_FILTER_NO_TS) {
			ctx->prev_cts = ctx->cts;
			ctx->cts = ts;
		}
		ts = gf_filter_pck_get_dts(pck);
		if (ts != GF_FILTER_NO_TS) {
			if (ctx->full_au_source) {
				ctx->prev_dts = ctx->dts;
				ctx->dts = ts;
			} else {
				GF_FilterClockType ck_type = gf_filter_pid_get_clock_info(ctx->ipid, NULL, NULL);
				if (ck_type==GF_FILTER_CLOCK_PCR_DISC)
					ctx->dts = ts;
				else if (ctx->dts<ts)
					ctx->dts=ts;
				if (!ctx->prev_dts) ctx->prev_dts = ts;
				else if (ctx->prev_dts != ts) {
					u64 diff = ts;
					diff -= ctx->prev_dts;
					if (!ctx->cur_fps.den)
						ctx->cur_fps.den = (u32) diff;
					else if (ctx->cur_fps.den > diff)
						ctx->cur_fps.den = (u32) diff;
					ctx->prev_dts = ts;
				}
			}
		}
		ctx->pck_duration = gf_filter_pck_get_duration(pck);
		if (ctx->src_pck) gf_filter_pck_unref(ctx->src_pck);
		ctx->src_pck = pck;
		gf_filter_pck_ref_props(&ctx->src_pck);
		gf_filter_pck_get_framing(pck, &ctx->input_is_au_start, NULL);
	}
}

public char * shell_quoten(constant char *s, size_t slen)
{
	constant char *p;
	char *np;
	char *newstr;
	size_t len;
	constant char *esc = get_meta_escape();
	size_t esclen = strlen(esc);
	lbool use_quotes = FALSE;
	lbool have_quotes = FALSE;
	len = 1; 
	for (p = s;  p < s + slen;  p++)
	{
		len++;
		if (*p == openquote || *p == closequote)
			have_quotes = TRUE;
		if (metachar(*p))
		{
			if (esclen == 0)
			{
				use_quotes = TRUE;
			} else
			{
				len += esclen;
			}
		}
	}
	if (use_quotes)
	{
		if (have_quotes)
			return (NULL);
		len = slen + 3;
	}
	newstr = np = (char *) ecalloc(len, sizeof(char));
	if (use_quotes)
	{
		SNPRINTF4(newstr, len, "%c%.*s%c", openquote, (int) slen, s, closequote);
	} else
	{
		constant char *es = s + slen;
		while (s < es)
		{
			if (metachar(*s))
			{
				strcpy(np, esc);
				np += esclen;
			}
			*np++ = *s++;
		}
		*np = '\0';
	}
	return (newstr);
}

bool HTMLMediaElement::ShouldShowControls(
    const RecordMetricsBehavior record_metrics) const {
  Settings* settings = GetDocument().GetSettings();
  if (settings && !settings->GetMediaControlsEnabled()) {
    if (record_metrics == RecordMetricsBehavior::kDoRecord)
      ShowControlsHistogram().Count(kMediaControlsShowDisabledSettings);
    return false;
  }
  if (FastHasAttribute(kControlsAttr)) {
    if (record_metrics == RecordMetricsBehavior::kDoRecord)
      ShowControlsHistogram().Count(kMediaControlsShowAttribute);
    return true;
  }
  if (IsFullscreen()) {
    if (record_metrics == RecordMetricsBehavior::kDoRecord)
      ShowControlsHistogram().Count(kMediaControlsShowFullscreen);
    return true;
  }
  LocalFrame* frame = GetDocument().GetFrame();
  if (frame && !GetDocument().CanExecuteScripts(kNotAboutToExecuteScript)) {
    if (record_metrics == RecordMetricsBehavior::kDoRecord)
      ShowControlsHistogram().Count(kMediaControlsShowNoScript);
    return true;
  }
  if (record_metrics == RecordMetricsBehavior::kDoRecord)
    ShowControlsHistogram().Count(kMediaControlsShowNotShown);
  return false;
}

