static bool access_pmu_evcntr(struct kvm_vcpu *vcpu,
			      struct sys_reg_params *p,
			      const struct sys_reg_desc *r)
{
	u64 idx;
	if (!kvm_arm_pmu_v3_ready(vcpu))
		return trap_raz_wi(vcpu, p, r);
	if (r->CRn == 9 && r->CRm == 13) {
		if (r->Op2 == 2) {
			if (pmu_access_event_counter_el0_disabled(vcpu))
				return false;
			idx = vcpu_sys_reg(vcpu, PMSELR_EL0)
			      & ARMV8_PMU_COUNTER_MASK;
		} else if (r->Op2 == 0) {
			if (pmu_access_cycle_counter_el0_disabled(vcpu))
				return false;
			idx = ARMV8_PMU_CYCLE_IDX;
		} else {
			BUG();
		}
	} else if (r->CRn == 14 && (r->CRm & 12) == 8) {
		if (pmu_access_event_counter_el0_disabled(vcpu))
			return false;
		idx = ((r->CRm & 3) << 3) | (r->Op2 & 7);
	} else {
		BUG();
	}
	if (!pmu_counter_idx_valid(vcpu, idx))
		return false;
	if (p->is_write) {
		if (pmu_access_el0_disabled(vcpu))
			return false;
		kvm_pmu_set_counter_value(vcpu, idx, p->regval);
	} else {
		p->regval = kvm_pmu_get_counter_value(vcpu, idx);
	}
	return true;
}

set_range(bitstr_t *bits, int low, int high, int start, int stop, int step) {
	Debug(DPARS|DEXT, ("set_range(?,%d,%d,%d,%d,%d)\n",
			   low, high, start, stop, step))
	if (start < low || stop > high)
		return (EOF);
	start -= low;
	stop -= low;
	if (step == 1) {
		bit_nset(bits, start, stop);
	} else {
		for (int i = start; i <= stop; i += step)
			bit_set(bits, i);
	}
	return (OK);
}

static int wc_ecc_gen_k(WC_RNG* rng, int size, mp_int* k, mp_int* order)
{
    int err;
#ifdef WOLFSSL_SMALL_STACK
    byte* buf;
#else
    byte  buf[ECC_MAXSIZE_GEN];
#endif
#ifdef WOLFSSL_SMALL_STACK
    buf = (byte*)XMALLOC(ECC_MAXSIZE_GEN, NULL, DYNAMIC_TYPE_ECC_BUFFER);
    if (buf == NULL)
        return MEMORY_E;
#endif
    size += 8;
    err = wc_RNG_GenerateBlock(rng, buf, size);
    if (err == 0)
        err = mp_read_unsigned_bin(k, (byte*)buf, size);
    if (err == MP_OKAY) {
        if (mp_iszero(k) == MP_YES)
          err = MP_ZERO_E;
    }
    if (err == MP_OKAY) {
        if (mp_cmp(k, order) != MP_LT) {
            err = mp_mod(k, order, k);
        }
    }
    ForceZero(buf, ECC_MAXSIZE);
#ifdef WOLFSSL_SMALL_STACK
    XFREE(buf, NULL, DYNAMIC_TYPE_ECC_BUFFER);
#endif
    return err;
}

