  folly::Random::secureRandom(&buffer, 1);
  auto pid = fork();
  EXPECT_NE(pid, -1);
  if (pid) {
    int status = 0;
    folly::Random::secureRandom(&buffer, 1);
    auto pid2 = wait(&status);
