	if (disable)
		return -EINVAL;
	pf_init_units();
	if (pf_detect())
		return -ENODEV;
	pf_busy = 0;
	if (register_blkdev(major, name)) {
		for (pf = units, unit = 0; unit < PF_UNITS; pf++, unit++)
			put_disk(pf->disk);
