static struct dentry *proc_task_instantiate(struct inode *dir,
	struct dentry *dentry, struct task_struct *task, const void *ptr)
{
	struct dentry *error = ERR_PTR(-ENOENT);
	struct inode *inode;
	inode = proc_pid_make_inode(dir->i_sb, task);
	if (!inode)
		goto out;
	inode->i_mode = S_IFDIR|S_IRUGO|S_IXUGO;
	inode->i_op = &proc_tid_base_inode_operations;
	inode->i_fop = &proc_tid_base_operations;
	inode->i_flags|=S_IMMUTABLE;
	inode->i_nlink = 4;
#ifdef CONFIG_SECURITY
	inode->i_nlink += 1;
#endif
	dentry->d_op = &pid_dentry_operations;
	d_add(dentry, inode);
	if (pid_revalidate(dentry, NULL))
		error = NULL;
out:
	return error;
}

void verifyDirectoryPermissions(const string &path) {
	TRACE_POINT();
	struct stat buf;
	if (stat(path.c_str(), &buf) == -1) {
		int e = errno;
		throw FileSystemException("Cannot stat() " + path, e, path);
	} else if (buf.st_mode != (S_IFDIR | parseModeString("u=rwx,g=rx,o=rx"))) {
		throw RuntimeException("Tried to reuse existing server instance directory " +
			path + ", but it has wrong permissions");
	} else if (buf.st_uid != geteuid() || buf.st_gid != getegid()) {
		throw RuntimeException("Tried to reuse existing server instance directory " +
			path + ", but it has wrong owner and group");
	}
}

StatusOr<std::vector<int64_t>> GetStride(XlaOpKernelContext* ctx) {
  if (ctx->num_inputs() == 1) {
    return stride_;
  }
  const TensorShape stride_shape = ctx->InputShape(2);
  if (!TensorShapeUtils::IsVector(stride_shape)) {
    return errors::InvalidArgument("stride must be a vector, not shape ",
                                   stride_shape.DebugString());
  }
  if (stride_shape.num_elements() != num_dims()) {
    return errors::InvalidArgument(
        "Sliding window stride field must "
        "specify ",
        num_dims(), " dimensions");
  }
  std::vector<int64_t> stride;
  auto status = ctx->ConstantInputAsIntVector(2, &stride);
  if (!status.ok()) {
    return status;
  }
  return stride;
}

ut32 armass_assemble(const char *str, ut64 off, int thumb) {
	int i, j;
	char buf[128];
	ArmOpcode aop = {.off = off};
	for (i = j = 0; i < sizeof (buf) - 1 && str[i]; i++, j++) {
		if (str[j] == '#') {
			i--; continue;
		}
		buf[i] = tolower ((const ut8)str[j]);
	}
	buf[i] = 0;
	arm_opcode_parse (&aop, buf);
	aop.off = off;
	if (thumb < 0 || thumb > 1) {
		return -1;
	}
	if (!assemble[thumb] (&aop, off, buf)) {
		return -1;
	}
	return aop.o;
}

